In picture #1, #2 and #3 my skin is dehydrated, heavily pigmented and I have lots of broken capillaries and the redness #rosacea - something I developed whilst being pregnant. 

The #hyperpigmentation has been caused by a combination of extended exposure to the sun and melasma, which appears when a steep rise in estrogen and progesterone levels stimulates excess melanin production in pregnancy. 

#Rosacea is a common skin condition that causes redness and visible blood vessels in your face. It may also produce small, red, pus-filled bumps. These signs and symptoms may flare up for weeks to months and then go away for a while but also very common to get when you’re pregnant. 

My skin has generally been okay through my teens, yes I’ve had my break outs and been diagnosed with mild acne but I wouldn’t have said it was bad. 

I’ve tried so many products over the years medicated, non medicated, high street, branded, natural, you name it I’ve tried but when you find something you really like and it works for you then stick to it! 

Back in April I was getting really down about my skin, lockdown was in full swing and I’d been using some medicated cream that the dermatologist had prescribed but I really couldn’t see any changes. So after having several conversations with my mum she convinced me to try @tropicskincare a purely natural, vegan friendly, plant based skincare range. I started off using the Smoothing Cleanser because I’m always taking my makeup off and I was immediately sold on that, it’s magic! then I had a skincare consultation and started to use some of the treatment serums for my pigmentation and rosacea and wow 🤩 3 months later you can definitely see the difference. My skin is calmer, no visable blemishes/spots and my pigmentation is lighter and generally I have a lovely glow to my skin. 

